('db6bb530-56be30a9-c20a0702', 'Phim này ổn đấy. Mình không có nhiều kỳ vọng và được gặp đúng những gì mình mong đợi. Nếu bạn đang tìm một bộ phim nhẹ nhàng, hãy xem nó!', '2023-06-15 21:07:18.245000', 0, 0, 3, '2023-06-15 21:07:18.245000', 1, 'fef32e6b-d92f9396-e3fd93a6'),
('dd1d5df3-a8d91a99-466af118', 'Phim này thật tuyệt vời! Cốt truyện hấp dẫn và diễn xuất xuất sắc. Những pha hành động đỉnh cao và tạo hình nhân vật rất đặc sắc. Một bộ phim không thể bỏ qua!', '2023-06-15 21:07:18.470000', 0, 0, 4, '2023-06-15 21:07:18.470000', 4, 'fef32e6b-d92f9396-e3fd93a6'),
('ddb0c34b-ea7b0f5a-32085639', 'Tôi không thể tìm thấy từ nào để miêu tả phim này! Nó thực sự tuyệt vời. Cốt truyện gây cấn, cảnh quay đẹp mắt và diễn xuất xuất sắc. Tôi đã bị lôi cuốn từ đầu đến cuối.', '2023-06-15 21:07:18.575000', 0, 0, 5, '2023-06-15 21:07:18.576000', 5, 'fef32e6b-d92f9396-e3fd93a6'),
('e12bc7ed-4460dfe2-9974916c', 'Tuyệt vời! Phim có cốt truyện gây cấn và diễn xuất xuất sắc. Mình đã bị lôi cuốn từ đầu đến cuối. Đây là một trong những bộ phim hay nhất mà tôi từng xem.', '2023-06-15 21:07:19.101000', 0, 0, 5, '2023-06-15 21:07:19.101000', 11, 'fef32e6b-d92f9396-e3fd93a6'),
('e147ceba-7302ad89-2fd0303b', 'Tuyệt vời! Đây là một trong những bộ phim xuất sắc nhất mà tôi từng xem. Cốt truyện thông minh và diễn xuất ấn tượng. Đáng để dành thời gian để xem!', '2023-06-15 21:07:19.800000', 0, 0, 5, '2023-06-15 21:07:19.800000', 18, 'fef32e6b-d92f9396-e3fd93a6'),
('e1ddf6d9-6b4dbf68-6311f712', 'Tuyệt vời! Đây là một trong những bộ phim xuất sắc nhất mà tôi từng xem. Cốt truyện thông minh và diễn xuất ấn tượng. Đáng để dành thời gian để xem!', '2023-06-15 21:07:19.534000', 0, 0, 5, '2023-06-15 21:07:19.534000', 15, 'fef32e6b-d92f9396-e3fd93a6'),
('e3001214-e6ed2fc3-25504ff2', 'Tuyệt vời! Phim có cốt truyện sâu sắc và ý nghĩa. Diễn xuất xuất sắc và tạo hình nhân vật độc đáo. Mình đã yêu thích từ đầu đến cuối!', '2023-06-15 21:07:18.534000', 0, 0, 5, '2023-06-15 21:07:18.534000', 4, 'fef32e6b-d92f9396-e3fd93a6'),
('e3695b39-6fb7419c-b902a8f0', 'Tuyệt vời! Đây là một trong những bộ phim xuất sắc nhất mà tôi từng xem. Cốt truyện thông minh và diễn xuất ấn tượng. Đáng để dành thời gian để xem!', '2023-06-15 21:07:18.976000', 0, 0, 5, '2023-06-15 21:07:18.976000', 9, 'fef32e6b-d92f9396-e3fd93a6'),
('e6462277-0543e5f4-4349015d', 'Không thích phim này lắm. Cốt truyện tẻ nhạt và diễn xuất kém. Mình không thấy hứng thú khi xem.', '2023-06-15 21:07:18.410000', 0, 0, 2, '2023-06-15 21:07:18.410000', 3, 'fef32e6b-d92f9396-e3fd93a6'),
